import { Suspense } from 'react';
export default function Home ({image}){

    return (
        <Suspense fallback={<h1>Loading profile...</h1>}> 
        <div> 
            <img src ={image} alt="slika" className='home-img img-fluid center-block d-block mx-auto'/>
        </div>
        </Suspense>
    )
}
